import axios from "axios";
const backendUrl = `http://127.0.0.1:localhost:4002/api/v1/auth`;

export const registerUser = async ({ name, email, password }) => {
    try {
        console.log(name);
        await axios(`${backendUrl}/register`, {
            action: " ",
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            data: JSON.stringify({
              name: name,
              email: email,
              password: password
            }),
          });
        //   setActiveForm("logIn");
    } catch (error) {
        console.log(error);
        alert("Something went wrong")
    }
};

export const loginUser = async ({ email, password }) => {
    try {
        await axios(`${backendUrl}/login`, {
            action: " ",
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            data: JSON.stringify({
              email: email,
              password: password
            }),
          });
    } catch (error) {
        console.log(error);
        alert("Something went wrong")
    }
}
